import React,{useState} from 'react'
import { Form, Button  } from 'antd';
import {  LockOutlined } from '@ant-design/icons';
import SubSelect from './subSelect'
import Category from './Category'
import SubCategory from './SubCategory'
import PriceRate from './PriceRate'
export default function NormalLoginForm({value,setValue}) {

    const onFinish = (values) => {
      console.log('Received values of form: ', values);
    };

    return (
      <Form
        name="normal_login"
        className="login-form"
        initialValues={{
          remember: true,
        }}
            onFinish={onFinish}
            style={{background:"white",padding:14}}
        >
            <Form.Item  style={{fontSize:'1.06rem',fontWeight:500}}>
                ประเภทร้านค้า
             </Form.Item>
        <Form.Item >   
          <Category value={value} setValue={ setValue}/>
            </Form.Item>
            <Form.Item>
                <SubSelect />
            </Form.Item>
        <Form.Item>
          <>ช่วงราคาสินค้า (บาท)</>
      <PriceRate/>
        </Form.Item>
        {value !== 0  && value !== 3 &&

        <Form.Item >   
        <SubCategory index={value} />
          </Form.Item>
        }

        <Form.Item>
          <Button type="default" htmlType="submit" className="login-form-button" style={{width:'100%'}}>
            ตกลง
          </Button>

        </Form.Item>
      </Form>
    );
  };
